import React, { Component } from "react";
import './WhyUs.css'
import Slider from "react-slick";
import IMG from '../assets/psychiatristportfolio4.jpg'
import IMG2 from '../assets/psychiatristportfolio6.jpg'
import IMG3 from '../assets/psychiatristportfolio8.jpg'

function CustomSlide(props) {
  const { index, ...otherProps } = props;
  return (
    <div {...otherProps}>
     <div className="slide">
            <div className="text">
              <div>
                <img src={IMG} alt="" />
              </div>
              <h1>Successfuk Stories</h1>
              <span>Lorem, ipsum dolor sit amet consectetur adipisicing elit. Tenetur, labore.</span>
              <strong>Ricky and Martin galler story </strong>
              <p>Lorem ipsum dolor sit amet, consectetur adipisicing elit. Ab dolor incidunt ratione sunt illo minima assumenda accusamus modi, laborum, aut asperiores fugit hic obcaecati libero.</p>
            </div>
          </div>
    </div>
  );
}

function CustomSlides() {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };
  return (
    <div className="story">
       <div className="slider-container">
      <Slider {...settings}>
        <CustomSlide index={1} />
        <CustomSlide index={2} />
        <CustomSlide index={3} />
      </Slider>
    </div>
    </div>
   
  );
}

export default CustomSlides;
